import React from 'react';
import '../App.css';

function FeaturesPage() {
  const featuresData = [
    {
      tag: 'Growth',
      title: 'Dynamic Conditional Logic',
      desc: 'Get high-quality design work at a fraction of the cost.',
    },
    {
      tag: 'Growth',
      title: 'Real time Ai Summaries',
      desc: 'We have the expertise to make your vision a reality.',
    },
    {
      tag: '',
      title: 'Security',
      desc: "We're ready to meet your evolving needs.",
    },
    {
      tag: 'Growth',
      title: 'Analytics & Reporting',
      desc: 'Get high-quality design work at a fraction of the cost.',
    },
    {
      tag: '',
      title: 'Seamless Integration',
      desc: 'We have the expertise to make your vision a reality.',
    },
    {
      tag: '',
      title: 'Payment Processing',
      desc: "We're ready to meet your evolving needs.",
    },
    {
      tag: '',
      title: 'Customizable Intake Forms',
      desc: 'Get high-quality design work at a fraction of the cost.',
    },
    {
      tag: '',
      title: 'Voice Input Support',
      desc: 'We have the expertise to make your vision a reality.',
    },
    {
      tag: '',
      title: '?????????',
      desc: "We're ready to meet your evolving needs.",
    },
  ];

  return (
    <div className="features-page">
      <h2 className="features-title">Our Features</h2>
      <div className="features-grid">
        {featuresData.map((item, idx) => (
          <div className="feature-card" key={idx}>
            {item.tag && <div className="feature-tag">{item.tag}</div>}
            <h3>{item.title}</h3>
            <p>{item.desc}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default FeaturesPage;
